    <p>{`It is possible to install RedisInsight using Helm chart. A full-featured desktop GUI client, RedisInsight is an essential tool for Redis developers. It is a lightweight multi-platform management visualization tool that helps you design, develop, and optimize your application capabilities in a single easy-to-use environment. RedisInsight not just makes it easier to interact with your databases and manage your data, but also helps in managing Redis Cluster with ease.`}</p>
    <h2 {...{
      "id": "getting-started"
    }}>{`Getting Started`}</h2>
    <h3 {...{
      "id": "step-1-install-the-prerequisites"
    }}>{`Step 1. Install the Prerequisites`}</h3>
    <p>{`Install Docker Desktop for Mac and enable Kubernetes as shown below:`}</p>
    <p><img alt={"alt_text"} src={require("!url-loader?limit=10000&name=assets/images/[name]-[hash].[ext]&fallback=file-loader!./images/image1.png").default} title="image_tooltip" /></p>
