      "id": "step-2-install-helm-on-your-mac-system"
    }}>{`Step 2. Install Helm on your Mac system`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` brew install helm
`}</code></pre>
    <h3 {...{
      "id": "step-3-verify-if-helm-is-installed-correctly"
    }}>{`Step 3. Verify if helm is installed correctly`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` helm version
 version.BuildInfo{Version:"v3.6.1",   
 GitCommit:"61d8e8c4a6f95540c15c6a65f36a6dd0a45e7a2f", GitTreeState:"dirty", 
 GoVersion:"go1.16.5"}
`}</code></pre>
    <h3 {...{
      "id": "step-4-download-redisinsight-helm-chart"
    }}>{`Step 4. Download RedisInsight Helm Chart`}</h3>
    <pre><code parentName="pre" {...{}}>{` wget https://docs.redislabs.com/latest/pkgs/redisinsight-chart-0.1.0.tgz
`}</code></pre>
    <h3 {...{
      "id": "step-5-verify-if-kubernetes-is-up-and-running"
    }}>{`Step 5. Verify if Kubernetes is up and running`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` kubectl get nodes
 NAME             STATUS   ROLES    AGE   VERSION 
 docker-desktop   Ready    master   22d   v1.19.7
`}</code></pre>
    <h3 {...{
      "id": "step-6-install-redisinsight-using-helm-chart"
    }}>{`Step 6. Install RedisInsight using Helm chart`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` helm install redisinsight redisinsight-chart-0.1.0.tgz --set service.type=NodePort

 NAME: redisinsight
 LAST DEPLOYED: Sat Jun 26 11:40:11 2021
 NAMESPACE: default 
 STATUS: deployed
 REVISION: 1
 NOTES:
 1. Get the application URL by running these commands:
  export NODE_PORT=$(kubectl get --namespace default -o   
 jsonpath="{.spec.ports[0].nodePort}" services redisinsight-redisinsight-chart)
  export NODE_IP=$(kubectl get nodes --namespace default -o  
 jsonpath="{.items[0].status.addresses[0].address}")
  echo http://$NODE_IP:$NODE_PORT
`}</code></pre>
    <h3 {...{
      "id": "step-7-get-the-application-url"
    }}>{`Step 7. Get the application URL`}</h3>
    <pre><code parentName="pre" {...{
        "className": "language-bash"
      }}>{` export NODE_PORT=$(kubectl get --namespace default -o jsonpath="{.spec.ports[0].nodePort}" services redisinsight-redisinsight-chart)
